'''Matt Craighead''' was the founder, and originally the main designer, of the video game ''[[Utumno (video game)|Utumno]]''. Matt stopped working on ''Utumno'' in [[1998]] and the game was cancelled; after eleven years the game was revived in [[2009]].<ref>[http://utumno.medicinestorm.com/archive/index.php Matt Craighead's Utumno, Archive]</ref>

